import { createIcon } from "../icon/createIcon";

export const ExportIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ExportIcon">
    <path d="M4 1v1H1v8h3v1H0V1h4z" />
    <path d="m7 3 4 2.985L7 9l-.001-2.02H2V4.99h4.999L7 3z" />
  </svg>,
  "Export",
  "export"
);
